css:
@-moz-document domain("savetomp3.co") {
::-webkit-scrollbar-track {
             -webkit-box-shadow: inset 0 0 0px rgba(0, 0, 0, 0.3);
             border-radius: 10px;
             background-color: #212121;
        }
        html[hide-scrollbar="true"] ::-webkit-scrollbar{display:none}
        ::-webkit-scrollbar {
             width: 10px;
             background-color: #212121;
        }
        ::-webkit-scrollbar-thumb {
             border-radius: 10px;
             -webkit-box-shadow: inset 0 0 0px rgba(0, 0, 0, .3);
             background-color: #004ebf;
        }

body, .mb_header {
    background: #111;
}
.embed-submit-field input, .funct, .inst, .title-val, .btn, .media {
    background: #222;
    border-color: #333;
}
.intro h2, h1, h2, h3, h4, h5, h6, .mb_home .text-inner h1, .important, .important-faq, .media-heading {
    color: #d9d7d7
}
.intro p, li, .mb_header #navbar li a span, .copyright, p.fbfoot, p {
    color: #ccc;
}
}
